import "./write.css";

export default function Write() {
  return (
    <div className="write">
      <form action="" className="writeForm">
        <div class="writeFormGroup">
          <label for="fileInput">
            <i className="fa-solid fa-plus"></i>
          </label>
          <input type="file" id="fileInput" style={{ display: "none" }} />
          <input
            type="text"
            placeholder="Title"
            className="writeInput"
            autofocus={true}
          />
        </div>
      </form>
    </div>
  );
}
